import styled from "styled-components";

export const Logo = styled.img`

width: 80px;

:hover{
    animation: swim;
}
@keyframes swim{
    0%,
    100%{
        transform: rotateX('angle');

    }
    25%{
        transform: rotateY('angle');
    }
    75%{
        transform: rotateZ('angle');
    }

}
`;
